data:
  definition: dispositif destiné à conduire le courant, mais non à l'établir ou le
    couper, utilisé avec un sélecteur de prises ou un sélecteur en charge pour permettre
    d'utiliser leurs contacts et les prises qui leur sont reliées plus d'une fois
    au cours du déplacement d'une position extrême à l'autre
